		/*
  	内置函数
  	将vars对象转换成字符
  */
		getFlashVars: function getFlashVars() {
			this.getVarsObject();
			var v = this.vars;
			var z = '';
			for (k in v) {
				if (k != 'flashplayer' && k != 'container' && v[k] != '') {
					if (z != '') {
						z += '&';
					}
					var vk = v[k];
					if (vk == true) {
						vk = 1;
					}
					if (vk == false) {
						vk = 0;
					}
					z += k + '=' + vk;
				}
			}
			return z;
		},
		/*
  	内置函数
  	将vars格式化成flash能接受的对象。再由getFlashVars函数转化成字符串或由newVideo直接使用
  */
		getVarsObject: function getVarsObject() {
			var v = this.vars;
			var f = '',
			    d = '',
			    w = ''; //f=视频地址，d=清晰度地址,w=权重，z=最终地址
			var arr = this.VA;
			var prompt = v['prompt'];
			var i = 0;
			for (i = 0; i < arr.length; i++) {
				var arr2 = arr[i];
				if (arr2) {
					if (f != '') {
						f += '|';
						d += '|';
						w += '|';
					}
					f += arr2[0].replace(/&/g, '%26');
					d += arr2[2];
					w += arr2[3];
				}
			}
			if (v['preview'] != null) {
				v['previewscale'] = v['preview']['scale'];
				v['preview'] = v['preview']['src'].join('|');
			}
			if (prompt != null) {
				v['prompt'] = '';
				v['prompttime'] = '';
				for (i = 0; i < prompt.length; i++) {
					if (v['prompt'] != '') {
						v['prompt'] += '|';
						v['prompttime'] += '|';
					}
					v['prompt'] += prompt[i]['words'];
					v['prompttime'] += prompt[i]['time'];
				}
			}
			v['video'] = f;
			v['definition'] = d;
			v['weight'] = w;
			v['logo'] = this.logo;
			var newV = {};
			for (var k in v) {
				if (v[k] != null) {
					newV[k] = v[k];
				}
			}
			this.vars = newV;
		},
		/*
  	内置函数
  	将embedSWF里的param的对象进行转换
  */
		getFlashplayerParam: function getFlashplayerParam() {
			var w = '',
			    v = '',
			    o = {
				allowScriptAccess: 'always',
				allowFullScreen: true,
				quality: 'high',
				bgcolor: '#000'
			};
			for (var e in o) {
				w += e + '="' + o[e] + '" ';
				v += '<param name="' + e + '" value="' + o[e] + '" />';
			}
			w = w.replace('movie=', 'src=');
			return {
				w: w,
				v: v
			};
		},
